import './Main.css';
import { useNavigate } from 'react-router-dom';

function Main() {
  const navigate = useNavigate();

  const handleTouch = () => {
    navigate('/LIA'); // 다음 페이지로 SPA 방식 이동
  };

  return (
    <div className="Main" onClick={handleTouch} onTouchStart={handleTouch}>
      <div className="Main__content">
        <div className="Main__title">LIA</div>
        <div className="Main__subtitle">Listen, Interact, Assist</div>
      </div>
      <div className="Main__guide">Tap to continue</div>
    </div>
  );
}

export default Main;
